import React from "react"
import Card from "../MovieCard/MovieCard"

const AllMovies = (movies) => {
	console.log(movies)




	const movieCards = movies.map(movie => {
		return (
			<Card 
				title={movie.title}
				backdrop_path={movie.backdrop_path}
			/>
		)
	})
	return (
		<section>
			{movieCards}
		</section>
	)
}

export default AllMovies
